import React, { Component } from 'react';
import { connect } from 'react-redux';

import HeaderDefault from '../../components/shared/headers/HeaderDefault';
import Products from '../../components/partials/hobbiyst/products';
import HeaderMobile from '../../components/shared/headers/HeaderMobile';
import NavigationList from '../../components/shared/navigation/NavigationList';
import SubscribePopup from '../../components/shared/SubscribePopup';
// import '../../scss/home-default.scss';
import FooterDefault from '../../components/shared/footers/FooterDefault';
import HomeNewArrivals from '../../components/partials/NewArivalsSlider';
import HomePromotions from '../../components/partials/HomePromotions';
import HobbyistHomeSlider from '../../components/partials/HobbyistHomeSlider';

class Dashboard extends Component {
    constructor(props) {
        super(props);
        this.state = {
            subscribe: false,
        };
    }




    render() {
        const breadCrumb = [
            {
                text: 'Hobbiyst',
                url: '/',
            },
            {
                text: 'Products',
            },
        ];
        const { subscribe } = this.state;
        return (
            <div className="site-content">
                <HeaderDefault />
                <HeaderMobile />
                <NavigationList />
                <SubscribePopup active={subscribe} />
                <main id="homepage-1">
                    <BreadCrumb breacrumb={this.breadCrumb} />
                    <Products />
                    {/*<SiteFeatures />*/}
                    <HomeNewArrivals collectionSlug="deal_of_the_day" />
                    <HomePromotions />
                    <HobbyistHomeSlider collectionSlug="deal_of_the_day"/>
                </main>
                <FooterDefault />
            </div>
        );
    }
}


export default connect(state => state.collection)(Dashboard);
